#!/usr/bin/env python3


def reverseComplement(inputString):
  reverse = {'A':'T', 'T':'A', 'C':'G', 'G':'C'}
  for letter in inputString[::-1]:
    yield reverse[letter]


def main():
  inputString = ""
  for i in reverseComplement(inputString):
    print(i, end="")
  print()

if __name__ == '__main__':
  main()